import React from "react";

const Resume = () => {
  return (
    <div className="box" style={{ maxWidth: "800px", margin: "auto", padding: "2rem", borderRadius: "12px", boxShadow: "0 4px 10px rgba(0,0,0,0.1)" }}>
      <h2 className="title is-4 has-text-centered">Ryan Santiago</h2>
      <p className="subtitle is-6 has-text-centered">Full-Stack Developer</p>

      <hr />

      <div className="content">
        <h3 className="title is-5">Experience</h3>
        <p><strong>Software Engineer</strong> - Tech Company (2020 - Present)</p>
        <ul>
          <li>Developed and maintained modern web applications.</li>
          <li>Optimized backend performance and database queries.</li>
        </ul>

        <h3 className="title is-5">Education</h3>
        <p><strong>Bachelor of Computer Science</strong> - University XYZ (2016 - 2020)</p>

        <h3 className="title is-5">Skills</h3>
        <span className="tag is-primary">React</span>
        <span className="tag is-info">Node.js</span>
        <span className="tag is-success">MongoDB</span>
        <span className="tag is-warning">CSS</span>
      </div>
    </div>
  );
};

export default Resume;
